import { ThemeProvider } from 'styled-components/native';

import {
  useFonts,
  Poppins_400Regular,
  Poppins_500Medium,
  Poppins_600SemiBold,
  Poppins_700Bold
} from '@expo-google-fonts/poppins';

import theme from './src/global/styles/theme';
import { Welcome } from './src/screens/Welcome';
import AppLoading from 'expo-app-loading';
import { SignIn } from './src/screens/SignIn';
import { Form } from './src/screens/ForgotPassword/Form';
import { Success } from './src/screens/ForgotPassword/Success';
import { SignUp } from './src/screens/Register/SignUp';
import { SignUpPassword } from './src/screens/Register/SignUpPassword';
import { SignUpSelfie } from './src/screens/Register/SignUpSelfie';
import { SignUpSelfieCheck } from './src/screens/Register/SignUpSelfieCheck';
import { SignUpSelfieDocuments } from './src/screens/Register/SignUpDocuments';

export default function App() {

  const [fontsLoaded] = useFonts({
    Poppins_400Regular,
    Poppins_500Medium,
    Poppins_600SemiBold,
    Poppins_700Bold
  });

  if(!fontsLoaded) {
    return (
      <AppLoading />
    )
  }

  return (
    <ThemeProvider theme={theme}>
      <SignUpSelfieCheck />
    </ThemeProvider> 
  );
}
